import { useState } from 'react';
import TextInput from './../TextInput/TextInput';

const BillOptions = (props) => {
  const [bill, setBill] = useState('');

  if (props.status !== "Busy")
    return (
      <div>
        <label>Bill:</label><span className="ml-4">$</span> <TextInput value={bill} onChange={e => setBill(e.target.value)} />
      </div>
    )
  else
    return (
      <div></div>
    )
}
export default BillOptions;
